        public static void Rotate(int[] nums, int k)
        {
            int l = nums.Length;
            k = k % l;

            ReverseArray(nums, 0, l-1);
            ReverseArray(nums, 0, k-1);
            ReverseArray(nums, k, l-1);

        }
        //args: nums array, si/ei => start/end index
        private static void ReverseArray(int[] nums, int si, int ei)
        {
            while (si>=0 && ei>=0 && si < ei)
            {
                int tmp = nums[si];
                nums[si] = nums[ei];
                nums[ei] = tmp;
                si++;
                ei--;
            }
        }

        //below one not completed
        public static void Rotate_3(int[] nums, int k)
        {
            int l = nums.Length;
            int j = 0;
            int[] tmpArr = new int[l];

            for (int i = l - 1; i >= l - k; i--)
            {
                if (i < 0)
                {
                    i = l - 1;
                    j = 0;
                }
                tmpArr[j++] = nums[i];
            }

            for (int i = 0; i < l - k; i++)
                tmpArr[j++] = nums[i];
        }


        ////  NOT WORKING ONLY FOR Case - 5 
        public static void Rotate_2(int[] nums, int k)
        {
            int l = nums.Length;

            while (k > 0)
            {
                int tmp = nums[l-1];

                for (int i = l-2; i >= 0; i--)
                    nums[i + 1] = nums[i];

                nums[0] = tmp;
                k--;
            }
        }

        ////  NOT WORKING ONLY FOR Case - 3,4,5 (not checked)
        public static void Rotate_1(int[] nums, int k)
        {
            if (k >= nums.Length)    
                k = nums.Length;

            int j = 0;
            int[] tmpArr = new int[k];

            for (int i=nums.Length - 1; i >= nums.Length - k; i--)
                tmpArr[j++] = nums[i];

            for (int i=nums.Length-1; i > k-1; i--)
                nums[i] = nums[i-k];

            j = 0;
            for (int i = k - 1; i >= 0; i--)
                nums[i] = tmpArr[j++];
        }
